var title_f17_17_17681="Secretion and metabolism PT";
var content_f17_17_17681=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F74939&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F74939&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 564px\">",
"   <div class=\"ttl\">",
"    Secretion and metabolism of PTH",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 544px; height: 332px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Secretion of intact PTH by the parathyroid glands is accompanied by release of a family of CPTH fragments (stippled shading), the amount of which, relative to intact PTH, increases at higher serum calcium concentrations. Intact PTH acts directly on PTH1Rs via its N-terminal sequence (black shading) in target tissues (ie, bone) or is directly cleared by liver or kidney. Hepatic clearance of PTH involves rapid proteolysis by Kupffer cells to N-terminal fragments (degraded in situ) and a series of C-terminal fragments, some of which reappear in the circulation (see text). CPTH fragments produced by the parathyroids and the liver are chemically similar or identical and include minimally N-truncated, long forms and some midregion fragments truncated at both ends. Like intact PTH, CPTH fragments can exert direct effects on bone cells via a novel class of CPTH receptors. CPTH fragments normally circulate at fivefold higher concentrations than intact PTH but are cleared predominantly by the kidney and thus accumulate disproportionately during renal failure.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Murray TM, Rao LG, Divieti P, Bringhurst FR. Parathyroid hormone secretion and action: evidence for discrete receptors for the carboxyl-terminal region and related biological actions of carboxyl-terminal ligands. Endocrine Reviews 2005; 26:78. file://edrv.endojournals.org/. Copyright &copy; 2005 The Endocrine Society.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
