var title_f17_17_17682="Spiral fracture of middle toe";
var content_f17_17_17682=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F81790&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F81790&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 505px\">",
"   <div class=\"ttl\">",
"    Spiral fracture of the proximal phalanx of the middle toe",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 485px; height: 482px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    On first glance, the position appears normal. However, comparing the orientation of the fractured toe with the adjacent toes helps one appreciate the slightly abnormal position. The tip of the third toe lies closer to the fourth toe than to the second due to 5 to 10 degrees of angulation. The middle and distal phalanx of the third toe have a slight \"curve\" laterally while the second and fourth appear to curve straight down or medially. This suggests 10 to 20 degrees of rotation at the fracture site. Although the angulation and rotation seen in this radiograph are well within the acceptable range, they could be improved by a gentle reduction maneuver before buddy taping to the second toe. Because the tip of the third toe angulates away from the second toe, buddy taping to the second toe would be preferable to taping to the fourth toe.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Robert L Hatch, MD, MPH.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
