" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Clinical features of radiation exposure in children",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?17/17/17689/contributors\">",
