var title_f17_17_17690="Pseudoxanthoma elasticum neck 1";
var content_f17_17_17690=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F80952%7EDERM%2F59135%7EDERM%2F70421&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F80952%7EDERM%2F59135%7EDERM%2F70421&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pseudoxanthoma elasticum",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 370px; height: 504px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This woman with pseudoxanthoma elasticum has numerous yellow asymptomatic papules on her neck and upper chest.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Copyright &copy; Yahia Albaili, DO, Dermatlas; file://www.dermatlas.org.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pseudoxanthoma elasticum",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 347px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Symmetric, confluent, yellow papules and redundant skin folds are present in this 38-year-old woman. The characteristic plucked chicken skin changes on the neck of patients with pseudoxanthoma elasticum are seen. An eye examination showed the characteristic angioid streaks.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Copyright &copy; Rakhesh SV, MD, Dermatlas; file://www.dermatlas.org.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pseudoxanthoma elasticum",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 293px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Yellow papules are present on the inner aspect of the lower lip. Infiltration of the buccal mucosa of the lip is the most common mucous membrane involvement in pseudoxanthoma elasticum.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Copyright &copy; Franziska Ringpfeil, MD, Dermatlas; file://www.dermatlas.org.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
