var title_f17_17_17691="Evaluation of anemia when ESA use is considered";
var content_f17_17_17691=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F60121&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F60121&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Evaluation for other causes of anemia in patients being considered for an erythropoiesis-stimulating agent",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"indent1\">",
"        Thorough drug exposure history",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Review of a peripheral blood smear, and in some cases, bone marrow examination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Analysis for iron, folate, or vitamin B12 deficiency, where indicated",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Assessment of reticulocyte count, occult blood loss, and renal insufficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        May also include:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Coombs' testing for patients with chronic lymphocytic leukemia (CLL), non-Hodgkin lymphoma, or a history of autoimmune disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Assessment of endogenous erythropoetin levels for patients with myelodysplastic syndrome (MDS)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Rizzo JD, Brouwers M, Hurley P, et al. American Society of Hematology/American Society of Clinical Oncology clinical practice guideline update on the use of epoetin and darbepoetin in adult patients with cancer. J Oncol Pract. 2010; 6:317.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
