var title_f17_17_17693="Management nosocomial VZV";
var content_f17_17_17693=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F52900&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F52900&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Infection control guidelines for the prevention and management of nosocomial VZV infection",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Screening of visitors and pediatric admissions",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. All admissions to the Pediatric Service (children less than 13 years of age) should be screened for infectious disease exposures and/or communicable infectious diseases by the staff of the admitting area and by the admitting nurse, using a standard form. Patients with a potentially communicable disease should be evaluated by the admitting physician for the necessity of isolation.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. All hospital visitors to an intensive care unit who are under 13 years of age should be screened for the presence of actual or incubating infectious diseases by a receptionist. The screened children should wear a designated badge at all times while in patient care areas to indicate that appropriate screening has taken place.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       3. The immunization status of all children should be reviewed during outpatient and inpatient hospital visits. Varicella vaccine should be offered to children as per recommendations of the Advisory Committee on Immunization Practices (ACIP) and American Academy of Pediatrics.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Management of patients exposed to VZV",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. Confirm source case has VZV infection. Typical varicella-zoster may be diagnosed by history and physical exam. In uncertain cases diagnosis may be aided by direct immunofluorescent stain, polymerase chain reaction (PCR) testing, and/or culture.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. If VZV infection is diagnosed in the source case, a determination should be made whether exposure has occurred. Exposure is defined as being in an enclosed air space with the source case (ie, same room) or in intimate contact with the source in an open area during a potentially contagious stage of illness. Varicella is considered contagious beginning 48 hours prior to the onset of rash and until all lesions are dried and crusted. Zoster is considered contagious only from the onset of rash.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       3. Susceptible patients are placed on airborne precautions if available. If unavailable, they should be placed in a private negative pressure room. If feasible, only varicella-immune personnel should care for patients during the incubation period. If non-immune personnel care for the patient, they should don an N-95 respirator prior to room entry. Isolation should be maintained from days 8 through 21 postexposure, unless the patient received VariZIG, in which case isolation is continued from days 8 through 28 following exposure. If varicella occurs, the patient is also placed on contact isolation.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       4. All exposed patients should be considered for post-exposure prophylaxis per guidelines by the American Academy of Pediatrics (Red Book) and Advisory Committee on Immunization Practices (ACIP).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       5. Attempts should be made to discharge all susceptible exposed patients during the incubation period.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       6. Elective admissions of susceptible exposed patients should be postponed during the incubation period.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Management of patients with Varicella or Zoster",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. All patients with varicella or zoster* are placed on airborne (private negative pressure room, air exhausted directly to the outside, &gt;6 air exchanges per hour)",
"       <strong>",
"        AND",
"       </strong>",
"       contact isolation. If a room meeting CDC airborne standards is not available, the patient may be housed in a private negative pressure room with adequate air exchanges. Gloves and gowns should be donned prior to entering the patient's room. Immune health care workers may enter the room without a mask.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. Employees without a history of varicella-zoster infection are encouraged to refrain from the care of patients with VZV infection when possible. When not possible, they should wear an N-95 respirator.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       3. Patients are maintained on isolation until all lesions are dry and crusted.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Management of staff with Varicella or Zoster infection",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. Staff with varicella or zoster on exposed surfaces are excused from work until all lesions are dry and crusted Staff with zoster that can be confined under a sterile bandage AND under clothes may work; however, they may not care for highly immunocompromised patients (eg, patients in the neonatal ICU, bone marrow transplant unit, etc.).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. Staff with varicella or zoster should be offered antiviral therapy.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Airborne isolation is mandatory for patients with disseminated zoster or immunocompromised patients with localized zoster. Although the CDC continues to recommend only contact precautions for immunocompetent patients with localized zoster, we recommend airborne and contact precautions (see text).",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from the UNC Hospitals' Infection Control Policy Manual; preexposure and postexposure management of health care workers are presented on separate tables.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
